import './App.css';
import SideBar from './components/SideBar/SideBar';
import Home from './components/Home/Home';
import About from './components/About/About';
import Services from './components/Services/Services';
import Resume from './components/Resume/Resume';
import Portifolio from './components/Portifolio/Portifolio';
import Testmonials from './components/Testmonials/Testmonials';
import Blog from './components/Blog/Blog';
import Contact from './components/Contact/Contact';
import Footer from './components/Footer/Footer';



function App() {
  const [displayAlert, setDisplayAlert] = use(true);

  const toggle = () => {
      setDisplayAlert(!displayAlert);
  }
  return (
        <div>
         <div className={displayAlert ? "alert show" : "alert"}>
            {displayAlert && (
                <span className="closebtn" onClick={toggle}>&times;</span>
            )}
            <strong>Notice</strong> Website Still Under Development.
        </div>
        <SideBar/>
      <main className='main'>
        <Home/>
        <About/>
        <Services/>
        <Resume/>
        <Portifolio/>
        <Testmonials/>
        <Blog/>
        <Contact/>

      </main>
      <Footer/>

    </div>
  );
}

export default App;
